# Structure for table "disponibilidad"
#

DROP TABLE IF EXISTS `disponibilidad`;
CREATE TABLE `disponibilidad` (
  `IdDisponibilidad` int(11) NOT NULL AUTO_INCREMENT,
  `IdRegCuenta` int(11) DEFAULT NULL,
  `Fecha` datetime DEFAULT NULL,
  `IdCuentaContable` bigint(12) DEFAULT NULL,
  `Descripcion` varchar(255) DEFAULT NULL,
  `Monto` double(15,5) DEFAULT NULL,
  `FechaVencimiento` datetime DEFAULT NULL,
  PRIMARY KEY (`IdDisponibilidad`),
  KEY `disponibilidad-regcuenta` (`IdRegCuenta`),
  CONSTRAINT `disponibilidad-regcuenta` FOREIGN KEY (`IdRegCuenta`) REFERENCES `regcuenta` (`idRegCuenta`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

