#
# Structure for table "cuenta"
#

DROP TABLE IF EXISTS `cuenta`;
CREATE TABLE `cuenta` (
  `idCuenta` bigint(20) NOT NULL AUTO_INCREMENT,
  `valor` double DEFAULT '0',
  `ref` varchar(300) DEFAULT NULL COMMENT 'cuentas de referencia',
  `status` int(11) DEFAULT '0' COMMENT 'nos dice si la cuenta tiene status sucio o limpio',
  `idMoneda` int(11) DEFAULT '1',
  `idCatalogoCuenta` bigint(20) NOT NULL DEFAULT '0',
  `idRegCuenta` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`idCuenta`),
  KEY `cuenta - moneda_idx` (`idMoneda`),
  KEY `cuenta - catalogocuenta` (`idCatalogoCuenta`),
  KEY `cuenta - regCuenta` (`idRegCuenta`),
  CONSTRAINT `cuenta - catalogocuenta` FOREIGN KEY (`idCatalogoCuenta`) REFERENCES `catalogocuenta` (`idCatalogoCuenta`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `cuenta - moneda` FOREIGN KEY (`idMoneda`) REFERENCES `moneda` (`idMoneda`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `cuenta - regCuenta` FOREIGN KEY (`idRegCuenta`) REFERENCES `regcuenta` (`idRegCuenta`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=48231 DEFAULT CHARSET=utf8;

