#
# Structure for table "valores"
#

DROP TABLE IF EXISTS `valores`;
CREATE TABLE `valores` (
  `IdTenencia` int(11) NOT NULL AUTO_INCREMENT,
  `IdRegCuenta` int(11) DEFAULT NULL,
  `Fecha` datetime DEFAULT NULL,
  `IdCuentaContable` bigint(15) DEFAULT NULL,
  `Descripcion` varchar(255) DEFAULT NULL,
  `NumeroTitulos` int(11) DEFAULT NULL,
  `TipoValor` varchar(255) DEFAULT NULL,
  `Emision` varchar(255) DEFAULT NULL,
  `Serie` varchar(255) DEFAULT NULL,
  `FechaVencimiento` datetime DEFAULT NULL,
  `PrecioLimpio` double(10,5) DEFAULT NULL,
  `Tasa` double(10,5) DEFAULT NULL,
  `IdTipoTasa` int(11) DEFAULT NULL,
  `IdCalificacion1` int(11) DEFAULT NULL,
  `IdCalificacion2` int(11) DEFAULT NULL,
  `IdCalificacion3` int(11) DEFAULT NULL,
  PRIMARY KEY (`IdTenencia`),
  KEY `tenencia -regcuenta` (`IdRegCuenta`),
  KEY `tipotasa-tenencia` (`IdTipoTasa`),
  KEY `tenencia-calif1` (`IdCalificacion1`),
  KEY `tenencia-calif2` (`IdCalificacion2`),
  KEY `tenencia-calif3` (`IdCalificacion3`),
  CONSTRAINT `tenencia -regcuenta` FOREIGN KEY (`IdRegCuenta`) REFERENCES `regcuenta` (`idRegCuenta`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tenencia-calif1` FOREIGN KEY (`IdCalificacion1`) REFERENCES `calificacion` (`IdCalificacion`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tenencia-calif2` FOREIGN KEY (`IdCalificacion2`) REFERENCES `calificacion` (`IdCalificacion`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tenencia-calif3` FOREIGN KEY (`IdCalificacion3`) REFERENCES `calificacion` (`IdCalificacion`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tipotasa-tenencia` FOREIGN KEY (`IdTipoTasa`) REFERENCES `tipotasa` (`IdTipoTasa`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

